    var where = "LAYERNAME:" + queryCategory;
    var parameter = "type=" + queryType + "&method=" + method + "&scope=" + scope + "&filterCustom=" + where + "&pageIndex=0&pageSize=350" + spaceQueryStr;
    this.EzPOISearch_sc(parameter, function (data) {
      var datas = data.groups[0] == undefined ? [] : data.groups[0].pois;
      var ss = 0;
      for (var i = 0; i < datas.length; i++) {
        if (datas[i].x == 0 || datas[i].x == "" || datas[i].x == undefined || datas[i].x == null || datas[i].y == 0 || datas[i].y == "" || datas[i].y == undefined || datas[i].y == null) {
          return "请输入正确的经纬度";
        }

        that.spArray.push("SP" + i);
        if (ss < DivIdArray.length) {
          this.playVedio(DivIdArray[ss], datas[i].customs.TDBH);
          that.SpArray.push({ id: i, tdbh: datas[i].customs.TDBH });
        }
        ss++;
        this.appMap.addOverlayPoint("SP" + i, parseFloat(datas[i].x), parseFloat(datas[i].y), "video", "", i, false, "", "", function (event) {
          var id = event.id.substring(2, event.id.length);
          if (that.SpArray.length < 4) {
            for (var k = 0; k < that.SpArray.length; k++) {
              if (id == that.SpArray[k].id) {
                break;
              }
            }
            that.SpArray.push({ id: id, tdbh: datas[id].customs.TDBH });
            callback();
          } else {
            alert('过长')
          }

        });
      }
    });
